package loopassignment;

import java.util.Scanner;

public class table2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		System.out.print("Enter any number :");
		
		int n=sc.nextInt();
		for(int i=1;i<=10;i++)
			System.out.println(i*n);

	}

}
